import Logo from "./images/clogo.jpeg";
import Modal from "react-bootstrap/Modal";
import "bootstrap/dist/css/bootstrap.min.css";
import CloseIcon from '@material-ui/icons/Close';
import GoogleLogin from 'react-google-login';

export function Login(param) {
    const [close, setclose] = useState(param);

    const Redirectgoogleaccout =() =>{

    }
    const closePopup =() =>{
        setclose(false)
    }
    const responseGoogle = (response) => {
        console.log(response.wt.SJ);
        localStorage.setItem("Google_image", response.wt.SJ);
        localStorage.setItem("Google_name", response.wt.Ad);
        setclose(false)
      }
  return (
    <Modal show={close}>
      <Modal.Body>
        <div className="container d-flex">
          <div className="row model-height">
            <div className="col-6 col-lg-6 left-div ">
              <div className="post-img ">
                <p className="tiitle-div">Keep Track of Your stcoks</p>
              </div>
            </div>
            <div className=" newsWrap">
              <div className="card-body">
                <p className="closeicons" onClick={closePopup}>
                  <CloseIcon />
                </p>
                <p className="image-icon">
                  <img
                    className="navbar-brand"
                    src={Logo}
                    alt="logo"
                    width="35px"
                  />{" "}
                  ALINEA INVEST
                </p>
                <div className="google-account">
                  <GoogleLogin
                    clientId="658977310896-knrl3gka66fldh83dao2rhgbblmd4un9.apps.googleusercontent.com"
                    buttonText="Continous with Google"
                    onSuccess={responseGoogle}
                    onFailure={responseGoogle}
                    cookiePolicy={"single_host_origin"}
                  />
                  ,
                </div>
              </div>
            </div>
          </div>
        </div>
      </Modal.Body>
    </Modal>
  );
}
